service.file:
#!/bin/sh # set tcpdump options here (see 'man tcpdump' for help) # (-s snap length, -C limit pcap file length, -n disable name resolution) DUMPOPTS="-n" TSHARK_PATH=/home/seraph/Desktop/tshark_output
if [ "x$1" = "xstart" ]; then
tcpdump ${DUMPOPTS} -w n1.eth0.pcap -i eth0 < /dev/null & tcpdump ${DUMPOPTS} -w n1.eth1.pcap -i eth1 < /dev/null &
pid=$! sleep 101.0s kill $pid
elif [ "x$1" = "xstop" ]; then mkdir -p ${TSHARK_PATH}/pcap mv *.pcap ${TSHARK_PATH}/pcap fi;

